import React from 'react';

function ImagenCargada({ selectedImageInfo }) {
  return (
    <div className='imgcargada'>Imagen Cargada
      <div className='muestraimagen'>
        <img src={selectedImageInfo.url} alt={selectedImageInfo.name} style={{ width: '200px', height: '300px' }} className='img' />
      </div>
    </div>
  );
}

export default ImagenCargada;
